import React, { useEffect, useState } from "react";
import { getAirQualityByStation } from "../services/api";

const AirQualityDisplay = ({ stationId }) => {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (stationId) {
      setError(null);
      setData(null);
      getAirQualityByStation(stationId)
        .then(setData)
        .catch(() => setError("Не вдалося завантажити дані якості повітря."));
    }
  }, [stationId]);

  if (!stationId) {
    return (
      <p style={{ textAlign: "center", fontStyle: "italic", color: "#555" }}>
        Оберіть станцію, щоб переглянути дані про якість повітря.
      </p>
    );
  }

  if (error) {
    return (
      <p style={{ color: "red", textAlign: "center", fontWeight: "bold" }}>
        {error}
      </p>
    );
  }

  if (!data) {
    return <p style={{ textAlign: "center" }}>Завантаження даних...</p>;
  }

  return (
    <div style={{ marginTop: "30px", textAlign: "center" }}>
      <h3>
        Якість повітря на станції{" "}
        <span style={{ color: "#0078D7" }}>"{data.station.name}"</span>
      </h3>

      <table
        style={{
          margin: "20px auto",
          borderCollapse: "collapse",
          width: "80%",
          maxWidth: "600px",
          boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
          borderRadius: "10px",
          overflow: "hidden",
        }}
      >
        <thead style={{ backgroundColor: "#0078D7", color: "white" }}>
          <tr>
            <th style={{ padding: "10px", border: "1px solid #ddd" }}>
              Параметр
            </th>
            <th style={{ padding: "10px", border: "1px solid #ddd" }}>
              Значення
            </th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td style={tdStyle}>PM2.5</td>
            <td style={tdValue}>{data.pm25}</td>
          </tr>
          <tr>
            <td style={tdStyle}>PM10</td>
            <td style={tdValue}>{data.pm10}</td>
          </tr>
          <tr>
            <td style={tdStyle}>CO₂</td>
            <td style={tdValue}>{data.co2}</td>
          </tr>
          <tr>
            <td style={tdStyle}>O₃</td>
            <td style={tdValue}>{data.o3}</td>
          </tr>
          <tr>
            <td style={tdStyle}>NO₂</td>
            <td style={tdValue}>{data.no2}</td>
          </tr>
          <tr>
            <td style={tdStyle}>Температура</td>
            <td style={tdValue}>{data.temperature} °C</td>
          </tr>
          <tr>
            <td style={tdStyle}>Вологість</td>
            <td style={tdValue}>{data.humidity} %</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

// Стилі для клітинок таблиці
const tdStyle = {
  padding: "10px",
  border: "1px solid #ddd",
  backgroundColor: "#f9f9f9",
  fontWeight: "bold",
  textAlign: "left",
  width: "50%",
};

const tdValue = {
  padding: "10px",
  border: "1px solid #ddd",
  textAlign: "center",
  color: "#0078D7",
  fontWeight: "bold",
  backgroundColor: "#fff",
};

export default AirQualityDisplay;
